import { Link ,useNavigate } from "react-router-dom";
const HomePage = () => {
    const navigate = useNavigate();

    const navigateHandler=()=>{
        navigate('/pr')
    }
  return (
    <>
      <h1>My Home Page</h1>
      <p>
        Go to <Link to="/products">the list of products</Link>.
      </p>
      <p>
        <button onClick={navigateHandler}>
                Navigate
        </button>
      </p>
    </>
  );
};

export default HomePage;
